CREATE VIEW `v_pessoa_fisica_juridica` AS
select
      pf.id_pessoa as 'ID_PESSOA',
     pf.af_nome as 'AF_NOME_RAZAO',
     pf.nr_cpf as 'NR_CPF_CNPJ',
     'Pessoa Física' as 'AF_TIPO',
     cid.af_nome as 'AF_NM_CIDADE',
     es.af_sigla as 'AF_SIGLA_UF',
     u.af_login as 'AF_LOGIN',
     p.id_pessoa_vinculadora as 'ID_PESSOA_PAI',
     p.id_atribuicao as 'ID_ATRIBUICAO',

     p.st_atv as 'ST_CADASTRO_PESSOA',
     u.st_atv as 'ST_CADASTRO_USUARIO',
     p.tp_pessoa as 'TP_PESSOA',
     pf.af_apelido as 'AF_APELIDO_NOME_FANTASIA',
     ga.id_grupo_acesso as 'ID_GRUPO_ACESSO',
     '' as 'AF_SIGLA_PJ',
     case pai.tp_pessoa
      when 0 then (select pfpai.nr_cpf from cad_pessoa_fisica pfpai
where pfpai.id_pessoa=pai.id_pessoa)
      when 1 then (select pjpai.nr_cnpj from cad_pessoa_juridica
pjpai where pjpai.id_pessoa=pai.id_pessoa)
      END as 'NR_CPF_CNPJ_PAI',
      arv.af_arvore as 'AF_ARVORE',
      arv.nr_nivel as 'NR_NIVEL',
      arv.ID_ARVORE_FAMILIAR as 'ID_ARVORE_FAMILIAR',
      sup.id_atribuicao as 'ID_SUPER_ATRIBUICAO',
      u.id_sup_usua as 'ID_SUPER_USUARIO'
from cad_pessoa_fisica pf
join cad_pessoa p on (p.id_pessoa=pf.id_pessoa)
left join seg_usuario u on (pf.id_pessoa=u.id_pessoa)
join cad_endereco en on (pf.id_pessoa=en.id_pessoa)
join cad_cidade cid on (cid.id_cidade=en.id_cidade)
join cad_estado es on (cid.id_estado=es.id_estado)
left join cad_pessoa pai on (p.id_pessoa_vinculadora=pai.id_pessoa)
left join seg_grupo_acesso ga on (u.id_grupo_acesso=ga.id_grupo_acesso)
join cad_arvore_familiar arv on (arv.id_pessoa=p.id_pessoa)
left join cad_pessoa sup on (u.id_sup_usua=sup.id_pessoa)

union
select

pj.id_pessoa as 'ID_PESSOA',
     pj.af_nm_razao_social as 'AF_NOME_RAZAO',
     pj.nr_cnpj as 'NR_CPF_CNPJ',
     'Pessoa Jurídica' as 'AF_TIPO',
     cid.af_nome as 'AF_NM_CIDADE',
     es.af_sigla as 'AF_SIGLA_UF',
     u.af_login as 'AF_LOGIN',
     p.id_pessoa_vinculadora as 'ID_PESSOA_PAI',
     p.id_atribuicao as 'ID_ATRIBUICAO',

p.st_atv as 'ST_CADASTRO_PESSOA',
     u.st_atv as 'ST_CADASTRO_USUARIO',
     p.tp_pessoa as 'TP_PESSOA',
     pj.af_nm_fantasia as 'AF_APELIDO_NOME_FANTASIA',
     ga.id_grupo_acesso as 'ID_GRUPO_ACESSO',
     pj.af_sigla as 'AF_SIGLA_PJ',
     case pai.tp_pessoa
      when 0 then (select pfpai.nr_cpf from cad_pessoa_fisica pfpai
where pfpai.id_pessoa=pai.id_pessoa)
      when 1 then (select pjpai.nr_cnpj from cad_pessoa_juridica
pjpai where pjpai.id_pessoa=pai.id_pessoa)
      END as 'NR_CPF_CNPJ_PAI',
      arv.af_arvore as 'AF_ARVORE',
      arv.nr_nivel as 'NR_NIVEL',
      arv.ID_ARVORE_FAMILIAR as 'ID_ARVORE_FAMILIAR',
      sup.id_atribuicao as 'ID_SUPER_ATRIBUICAO',
      u.id_sup_usua as 'ID_SUPER_USUARIO'
from cad_pessoa_juridica pj
join cad_pessoa p on (p.id_pessoa=pj.id_pessoa)
left join seg_usuario u on (pj.id_pessoa=u.id_pessoa)
join cad_endereco en on (pj.id_pessoa=en.id_pessoa)
join cad_cidade cid on (cid.id_cidade=en.id_cidade)
join cad_estado es on (cid.id_estado=es.id_estado)
left join cad_pessoa pai on (p.id_pessoa_vinculadora=pai.id_pessoa)
left join seg_grupo_acesso ga on (u.id_grupo_acesso=ga.id_grupo_acesso)
join cad_arvore_familiar arv on (arv.id_pessoa=p.id_pessoa)
left join cad_pessoa sup on (u.id_sup_usua=sup.id_pessoa)



